import React, { Component } from 'react'

state = {
      categorys: [
        { id:1 , catogryNames :"dodo"},{id:2 , catogryNames :"melo"}]

  }

export default class User extends Component {
  
 


  
  render() {
    
    return (
      <div className="user-list">

        <div className="catogry">
          {
             this.state.categorys.map(cato => (
                  <div key={this.cato.id}>{this.cato.catogryNames}</div>

             ))

          }
        </div>
        
      </div>
    )
  }
}
